import React from 'react';

const MedicsList = ({ medics, onMedicSelect }) => {
    // Check if medics is defined before using it
    const filteredMedics = medics ? medics.filter(medic =>
        medic.name.toLowerCase().includes(searchTerm.toLowerCase())
    ) : [];

    return (
        <ul>
            {filteredMedics.map((medic, index) => (
                <li key={index} onClick={() => onMedicSelect(medic)}>
                    <div>
                        <img src={medic.image} alt={medic.name} />
                        <div>
                            <h3>{medic.name}</h3>
                            <p>{medic.description}</p>
                            <p>{medic.location}</p>
                            <p>Rating: {medic.rating}</p>
                        </div>
                    </div>
                </li>
            ))}
        </ul>
    );
};

export default MedicsList;
